import React from "react";
import UserCard from "./UserCard";

const UserList = ({userList,removeUser}) => {
    return (
        <div>
            {
                userList.map((user,index) => { 
                    return (
                        <UserCard key={index} name={user.name} age={user.age} position={user.position}  onClickRemove={()=> removeUser(index)}/>
                    )
                })
            }
            
        </div>
    )
}

export default UserList;
